'''BF: Fails for large i/p's & K ; 
The time complexity of the given code is O(n * k), and the space complexity is O(1), where n is the length of the input string s and k is the size of the sliding window.'''
class Solution:
    def maxVowels(self, s: str, k: int) -> int:
        max_vowels = 0
        for i in range(len(s)):
            vowels = 0
            if (i+k <= len(s)): # to make sure there are 'k' #elements for the sliding window.
                for j in range(i,i+k):
                    if (s[j] == 'a' or s[j] == 'e'or s[j] == 'i' or s[j] == 'o' or s[j] == 'u'):
                        vowels += 1
                if (max_vowels < vowels):
                    max_vowels = vowels
        return max_vowels

s = ""
sol = Solution()
print(sol.maxVowels(s,3945))